  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, James Nelson and BEETHAM, Mary-Margaret
  JWILLIAMS, Gertrude Mary Beetham and RUSSELL, Andrew Hamilton
  JRUSSELL, Margaret Gertrude (Margot) and LOWRY, Thomas Coleman (Tom)
  VLOWRY, Edward Patrick and HEWITT, Jane Mary
  04> LOWRY, Mark Wilson
  b 21.03.1973
  Mark attended Huntley School and Christ's College. He has been shepherding in the Gisborne
  district and is presently overseas.
  04> LOWRY, Caroline Mary m on 20.12.1972 to MARIE, Philippe Gilbert Alfred
  b 13.12.1943
  b ** ** ****
  Philippe b. at Normandy, France. Divorced 1987. Address: "Wairewa", Little River, Banks Peninsula,
  Canterbury.
  Caroline graduated BA from Victoria University in 1989 and BMus from Canterbury University in 1993.
  01> MARIE, Cedric Gilbert Thomas
  b 28.09.1973
  Cedric is studying Commerce at Otago University. He enjoys skiing.
  02> MARIE, Alexandra Gisele Helene
  b 27.10.1974
  Address: 2 Sandilands Road, Fulham, London SW6 7AP, England.
  05>' WILLIAMS, Elsie Jane Beetham
  b 16.12.1874 d 01.10.1958
  Elsie b. at Frimley, Hastings and d. and bd at Havelock North. Elsie adopted her nieces, Christina and Meggie
  Williams, on the death of their parents in 1918. She lived at Frimley, Hastings until it was burnt down. She
  and her brothers gifted the land and garden to the City as Frimley Park. Elsie was for many years president of
  the Hastings Plunket Society. She was involved in the Girl Guide Movement, and during ww2 was acting New
  Zealand Chief Commissioner. She was also a foundation trustee of Woodford House School.
  06> WILLIAMS, Cyril Nelson Beetham m on 29.01.1907 to WILDER, Maud Margaret (Pearlie)
  b 01.11.1877 d 05.12.1918
  b 17.05.1879 d 21.07.1959
  Cyril b. at Frimley, Hastings, m. at St Matthew's Church, Fernside, Canterbury and d.
  and bd, at Trentham. Pearlie, d/o Edmond Wilder and Emily Maud Warner, b, at Marwell
  Lodge, Ouslebury, Hampshire, England.
  Cyril fought in the Boer War and farmed at "Atua" station, Elsthorpe. He died in the
  1918 'flu epidemic at the military camp where he had gone to nurse his brother Edric.
  Pearlie was for some years President of the Elsthorpe Country Women's Institute and
  served on the Dominion Executive. She was also an active member of the Elsthorpe Branch of the NZ Red Cross.
  Atua
  Originally part of "Edenham" station, "Atua" is located 11 km from Elsthorpe at the end of Atua Road. It was
  farmed first by Cyril Nelson Beetham Williams who divided in into three section. Cyril James Wilder Williams
  got "Atua" (485 hectares) and his son, James Timothy William Williams joined him in partnership in 1963.
  Adrian Christopher Charles Williams joined the partnership in 1973. Of the other sections, Timothy John Wilder
  Williams received "Aramutu" (615 hectares) and Barnabas Wilder Williams received "Papahope" (451 hectares).
  "Aramutu" is now farmed by Mark Antony Williams.
  01> WILLIAMS, Mary Margaret Wilder m on 08.01.1930 to WILLIAMS, Bevan Sydney
  (Bettie)
  b 13.02.1908 d 29.11.1979
  b 29.03.1904 d 18.06.1975
  Bettie b. at Taradale and bd. at Elsthorpe. Bevan, slo Francis James Williams and Edith Frances Standish,
  b. at Napier and bd, at Elsthorpe.
  The biographical notes and descendants of Bettie and Bevan are listed under Bevan's entry in this Family
  Tree.
